import React, { Component } from 'react';
import List from './List'
import './App.css';

class App extends Component {
  render() {
    return (
      <main className='App'>
        <header className='App-header'>
          <h1>Trelloyes!</h1>
        </header>
        <div className='App-list'>
          {this.props.lists.map((items=> <List id ={items.id} header ={items.header} 
          cards={items.cardIds.map(itemList=>this.props.allCards[itemList])}/>
            ))}
        </div>
      </main>
    );
  }
}

export default App;
